export const rookStartAndDest = {
    "c1": ["a1", "d1"],
    "g1": ["h1", "f1"],
    "c8": ["a8", "d8"],
    "g8": ["h8", "f8"]
}
Object.preventExtensions(rookStartAndDest);
Object.seal(rookStartAndDest);
Object.freeze(rookStartAndDest);
// module.exports = rookStartAndDest;
